import React, { Component} from 'react';

class Form extends Component {
    state={
        title: ""
    };
    onChangeHangler = () => {
        console.log("inputed")
    }
    render() {
        return (
            <form>
                <input 
                type="text" 
                placeholder="ToDo" 
                value={this.state.title} 
                onChange={()=> this.onChangeHangler()} />
                <input type="submit" value="Submit" />
            </form>
        );
    }
}

export default Form;
